ve slightly higher water needs than women, but an easy rule of thumb is 8, 8 ounce glasses of water per day! The 8 x 8 rule as a reminder. This works out to about 2 litres of water per day! 

What does the research show? Mild dehydration (1-3% of body weight) can impair mood, decrease concentration, increase headache frequency, and reduce physical endurance. 

Drinking adequate water (particularly before meals) can increase the metabolism and has been shown to have a weight loss benefit, especially when combined with a healthy diet. 

Drinking adequate amounts of water can prevent health problems including constipation, cancer, kidney stones, and acne. 
 
There are times when we need more water including after physical exertion, if you are breast feeding, or if you are suffering from vomiting or diarrhea. 

Water rich foods include watermelon, strawberries, cantaloupe, peaches, cucumber, lettuce, zucchini, bell peppers, cauliflower, and celery just to name a few! 

This is your daily reminder to drink more water 💦 💕 

