I have been doing this program for almost 9 weeks. I have watched my friends and teammates share some incredible transformations and weight loss progress. 

But I’m over here, still at pretty much the same weight I was almost 9 weeks ago. WHAT GIVES?! 🙄

I could be upset and ask myself what’s the point. But after a few years of doing this, I realize... the scale isn’t the ONLY measure of success. 

So do you wanna know what I’m celebrating? Buckle up, because it’s gonna be one heck of a victory ride 🥳

🏃🏼‍♀️ I am less winded after my workouts and my recovery time is much faster. 
💪🏻 I’m feeling and seeing muscles in places I forgot even had muscles 😂 I tend to carry weight in my upper body and today, I literally had to do a double take when I saw my back in the mirror. I’ve actually got definition in my back and shoulders now 😭
🍑 My butt is looking better than ever. It’s true... Juan even noticed 🤪 While, I was “gifted” with a big chest, God forgot to put some of that junk in the trunk too... so growing my booty has been a big goal of mine for years and it’s finally happening! 🙏🏻 
🥰 I am being CONSISTENT! It’s been a while since I completed a whole program in the length of time it’s supposed to take 🙈 and here I am already done with two rounds of the first program and about to wrap up a round of the advanced version! That’s THREE ROUNDS, 9-weeks of consistency and showing up when I didn’t always feel like it. That’s a huge deal for me. 

I know that if I keep this up, the scale WILL eventually change. I’ll lose fat and continue to build muscle and change my body. But I also accept that me being my best, healthiest, and happiest self doesn’t have to be a specific number on the scale. 

So, if you’re feeling down about “lack of progress” with your weight, I’m gonna ask you to take a step back and realize how MUCH you’ve REALLY accomplished and how far you’ve actually come already. 

Then, keep showing up, doing your best, and trust in the process! 

 And, if you need a little help, I’m here! My September Self-Love Club is still open for enrollment and I’d love to have you. ❤️";}i:69;a:1:{s:14:"comments_count";i:1;}i:70;a:1:{s:11:"likes_count";i:0;}i:71;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvPfczjZT4";}i:72;a:1:{s:5:"image";s:249:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118778514_690793864895854_6183999423201434222_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=110&_nc_ohc=0JtDsTu2y8MAX8Pt9rH&oh=d42bd5535c5403bdb0cf32877e35a627&oe=5F7AE8C3";}i:73;a:1:{s:4:"type";s:5:"image";}i:74;a:1:{s:8:"owner_id";i:45087838;}i:75;a:1:{s:14:"owner_username";s:0:"";}i:76;a:1:{s:14:"owner_fullname";s:0:"";}i:77;a:1:{s:9:"owner_pic";s:0:"";}i:78;a:1:{s:2:"id";s:19:"2391197755346078633";}i:79;a:1:{s:10:"short_code";s:11:"CEvPbB7HUup";}i:80;a:1:{s:12:"created_time";i:1599273007;}i:81;a:1:{s:7:"caption";s:612:"🏃‍♀️5k to complete the #RnRVirginiaBeach challenge.

